import ProjectCard from "./projectcard";

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { activeTab: 0 };
  }
  render() {
    return (
      // Project 1
      <Animation type="fadeInLeft">
        {/* // Project 1 */}
        <div className="projects-grid">
          <ProjectCard
            cardTitle="Stock Dashboard"
            cardText="A user inputs a stock ticker symbol on our custom HTML page, and the program will then fetch, clean, and display the relvant stock data. The program will also save past user searches in a databse."
